import {
  SideBarMenuButton,
  SideBarMenuName,
  FavoriteMenuIcon,
  NameMenuIcon,
} from './SideBarMenuButtonStyles.elements';

import React from 'react';

const SideBarMenuItem = ({ data }) => {
  return data.map((e) => (
    <SideBarMenuButton key={e.name} to=''>
      <SideBarMenuName onClick={e.onClick}>
        <NameMenuIcon>{e.name}</NameMenuIcon>
        {e.bool ? (
          <FavoriteMenuIcon onClick={e.isFavorite(false)}>👍</FavoriteMenuIcon>
        ) : (
          <FavoriteMenuIcon onClick={e.isFavorite(true)}>👎</FavoriteMenuIcon>
        )}
      </SideBarMenuName>
    </SideBarMenuButton>
  ));
};

export default SideBarMenuItem;
